import React from "react";
import Cards from "./cards";

const CardsList = ({ results, openPopup }) => {
  return (
    <div className="style">
      <div className="row">
        {results.map((result) => (
          <Cards key={result.id} result={result} onClick={() => openPopup} />
        ))}
      </div>
    </div>
  );
};
export default CardsList;
